import React from 'react';
import styled from 'styled-components';
import Logo from '../../Images/Logo/SpinzerLogoGolgenSilver.png';

const FooterDiv=styled.div`
width: 100vw;
height: 50vh;
background-color: #000d1a;

`;

const ImageDiv=styled.div`
width: 300px;
height: 100%;
`;

const ContentDiv=styled.div`
width: 100px;
height: 100%;
`;

const Footer = () => {
    return (
       <FooterDiv>
           <div class="container">
  <div class="row">
    <div class="col"> 
      <ImageDiv>
           <img src={Logo} style={{height:'20vh',marginTop:'50px'}}/>
           </ImageDiv>
    </div>
    <div class="col">
    <ContentDiv>

</ContentDiv>
    </div>
    <div class="col">
      Column
    </div>
  </div>
</div>
        
         
       </FooterDiv>
    )
}

export default Footer
